import React from "react";
import { View, Text } from "react-native";

const Footer = () => {
  return (
    <View className="bg-gray-800 py-8 px-4">
      <View className="flex-row justify-between items-center">
        <Text className="text-white">CSE Society: IIT ISM</Text>
        <Text className="text-white">Dhanbad</Text>
      </View>
    </View>
  );
};

export default Footer;
